    [],nt"title": "Fisheries-Independent Biological and Environmental Trawl Data
    from the Florida Fish and Wildlife Conservation Commission (1989-2005) as Part of
    the Comparative Assessment of Gulf Estuarine Systems (CAGES) Database (NODC Accession
    0115183)",nt"tracking_summary": {ntt"total": 16,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-26T23:42:58.276704",nt"name":
    "fisheries-independent-biological-and-environmental-trawl-data-from-the-florida-fish-and-wildlif",nt"isopen":
    false,nt"url": null,nt"notes": "The CAGES program (Comparative Assessment
    of Gulf Estuarine Systems) is designed to examine the differences between estuarine
    ecosystems and investigate why some are more productive than others. The program
    focuses on estuarine areas important to commercial fisheries and includes data on
    commercial finfish and invertebrate species, as well as other species commonly captured
    in trawl sampling. This Florida dataset is a subset of the CAGES Relational Database
    which is a compilation of fishery-independent data contributed by natural resource
    agencies of the Gulf States (Texas, Louisiana, Mississippi, Alabama, and Florida).
    This data set includes trawl and associated hydrographic data collected under the
    Fisheries-Independent Monitoring (FIM) Program, part of the Fish and Wildlife Research
    Institute (FWRI) of the Florida Fish and Wildlife Conservation Commission (FFWCC).
    Trawl data were used to calculate CPUE (catch per unit effort) at each station for
    the years 1989 through 2005.",nt"license_title": null,nt"extras": [{ntt"key":
